import { useContext } from "react"
import { dataContext } from "../ReactProject"
import { Container } from "react-bootstrap"
function GalleryCom() {
    const context=useContext(dataContext)
    return<div>
       <h2>{context.gallery.title}</h2>
       {
        context.gallery.galleryData.map((item,i)=>{
              return<div key={i} className='Container'>
                <Container>
                <img src={item.imgUrl}/>
                <div>
                    <h3>{item.details}</h3>
                </div>
                </Container>

              </div>
        })
       }
    </div>
}
export default GalleryCom
